import React from 'react'
import products from '../products'
import {Row,Col} from 'react'

const HomeScreen = () => {
  return (
    <>
      <h2>Latest Products</h2>
      {products.map((product)=>(
          <Col>
          <h3>{product.name}</h3></Col>
      ))}
    </>
  )
}

export default HomeScreen
